<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Document</title>
    <style>
        @import url("https://fonts.googleapis.com/css?family=Dosis:300,400,700,800");

        .particle-error,
        .permission_denied,
        #tsparticles {
            width: 100%;
            height: 100%;
            margin: 0px !important;
        }

        #tsparticles {
            position: fixed !important;
            opacity: 0.23;
        }

        .permission_denied {
            background: #FFF !important;
        }

        .permission_denied a {
            text-decoration: none;
        }

        .denied__wrapper {
            max-width: 390px;
            width: 100%;
            height: 390px;
            display: block;
            margin: 0 auto;
            position: relative;
            margin-top: 8vh;
        }

        .denied__wrapper img {
            width: 100%;
        }

        .permission_denied h1 {
            text-align: center;
            color: #666;
            font-family: "Dosis", sans-serif;
            font-size: 100px;
            margin-bottom: 0px;
            font-weight: 800;
        }

        .permission_denied h3 {
            text-align: center;
            color: #898989;
            font-size: 19px;
            line-height: 23px;
            max-width: 330px;
            margin: 0px auto 30px auto;
            font-family: "Dosis", sans-serif;
            font-weight: 400;
        }

        .permission_denied h3 span {
            position: relative;
            width: 65px;
            display: inline-block;
        }

        .permission_denied h3 span:after {
            content: "";
            border-bottom: 3px solid #ffbb39;
            position: absolute;
            left: 0;
            top: 43%;
            width: 100%;
        }

        .denied__link {
            background: #1E9FFF;
            color: #FFF;
            border: 1px solid #1E9FFF;
            outline: none;
            border-radius: 7px;
            width: 92px;
            height: 38px;
            line-height: 38px;
            font-size: 14px;
            text-align: center;
            margin: 0 auto;
            display: block;
            margin-bottom: 40px;
            margin-top: 25px;
            font-family: "Dosis", sans-serif;
            font-weight: 400;
        }

        .denied__link:hover {
            color: #1E9FFF;
            border-color: #1E9FFF;
            background: #FFF;
            cursor: pointer;
            opacity: 1;
        }


        @media (max-width: 600px) {
            .permission_denied h1 {
                font-size: 75px;
            }

            .permission_denied h3 {
                font-size: 16px;
                width: 200px;
                margin: 0 auto;
                line-height: 23px;
            }
        }
    </style>
</head>
